	<PARAM NAME="Keyword" VALUE="vectorp">

<P><A NAME="id_vectorp"></A><B>(vectorp <I>object</I>)</B></P>

<P>Returns <A HREF="robo8vck.htm">t</A> if <I>object</I> is a vector, otherwise <A HREF="robo4euk.htm">nil</A>.</P>
<PRE><CODE>(vectorp (vector 1 2 3 4 5 6)) =&gt; t
(vectorp '(a b c)) =&gt; nil</CODE></PRE>
